import React, { Component } from "react";
import { motion } from "framer-motion";
import { Link, Router } from "react-router-dom";

const middle = {
  rest: { scale: 1 },
  tap: {
    scale: 2,
    transition: {
      duration: 1,
    },
  },
};

const topbottom = {};

class HamburgerNav extends Component {
  state = {};
  render() {
    return (
      <motion.a
        href="#"
        style={{
          display: "flex",
          justifyContent: "space-between",
          flexDirection: "row",
          textDecoration: "none",
          position: "absolute",
          right: 20,
          top: 20,
        }}
        initial="rest"
        whileHover="tap"
        animate="rest"
      >
        <div>
          <motion.div
            style={{ height: 4, width: 28, backgroundColor: "black" }}
            variants={middle}
          ></motion.div>
          <motion.div
            style={{
              height: 4,
              backgroundColor: "black",
              width: 28,
            }}
            variants={middle}
          ></motion.div>
          <motion.div
            style={{
              height: 4,
              width: 28,
              backgroundColor: "black",
            }}
            variants={middle}
          ></motion.div>
        </div>
      </motion.a>
    );
  }
}

export default HamburgerNav;
